$(()=>{$.ajax({url:"http://127.0.0.1:3000/api/getinlanddiscount",dataType:"json",success:i=>{let d=i.result,s="";d.forEach(i=>{s+=`\n                <li  class="border-img"><a  href="./discount.html?productid=${i.productId}" class="">\n                        <div  class="img"><img\n                                src="${i.productImg.src}"\n                                alt="${i.productImg.alt}"></div>\n                        <div  class="title">${i.productName}</div>\n                        <div  class="subtit">${i.productPrice}</div>\n                        <div  class="info">\n                            <div  class="mall">${i.productFrom}</div>\n                        </div>\n                    </a></li>\n                `}),$(".inland-discount-list ul").html(s)}})});